import './App.css';
import Greet,{Home} from './components/Home'

function App() {
  const welcomeMsg="Welcome to Educative!";

  return (
    <div className="App">
      <Greet name = "Keerthana"/>
      <Home/>
      <div>
          <ExampleComponent welcomeMsg={welcomeMsg}/>
      </div>
    </div>
  );
}

export default App;
